import React from "react";
import "./topbar.css";
import Popover from "../popover/popover";
import { Link } from "react-router-dom";

function topbar() {
  return (
    <div>
      <header className="top-bar">
        <Link className="top-box" id="home-btn" to={"dashboard"}>
          Home
        </Link>


        <Link to={"/pr"} className="top-box" id="profile-btn">
          Profile
        </Link>
     
          <button className="top-box" id="about-us-btn">
            About-Us
          </button>

          <Link className="top-box" id="contact-us-btn">
            Contact-Us
          </Link>
    

        <Popover content="Hello">
          <button className="top-box" id="partners-btn">
            Partners
          </button>
        </Popover>

        <Link className="top-box" id="loan-type-btn" to={"/loan-application"}>
          Apply-Loan
        </Link>
      </header>
    </div>
  );
}
export default topbar;
